import React from "react"; // optional
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

function Navbar(props) {  // props fetched by App.js
  return (
    <>
      <nav className={`navbar navbar-expand-lg py-3 navbar-${props.mode} bg-${props.mode}`}>
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">{props.title}</Link>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className="nav-link" aria-current="page" to="/">Home</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/about">About</Link>
              </li>
            </ul>
            <div className="d-flex">
              <button onClick={props.toggleTitle} className={`btn btn-success me-2`}  disabled={props.alert == null ? false:true} >Toggle Title</button>
              <button onClick={props.toggleMode} className={`btn btn-${(props.mode =="light")?"dark":"light"}`}  disabled={props.alert == null ? false:true}> {props.modeName} </button>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
}

Navbar.propTypes = {        // This 'propTypes' must be in camel case otherwise you'll get error
  title: PropTypes.string   // this ensures that value of 'title' prop must be a string
};

Navbar.defaultProps = {
  title: "Text Editor"        // default props setting
};

export default Navbar;
